import React from 'react';
import styles from './NotificationCount.module.css';
import RoundWrapper from './util/RoundWrapper';

export default function NotificationCount(props) {
    return (
        <div onClick={props.Func} className={styles.notification_count}>
            <RoundWrapper diameter='40px' bgcolor={props.bgcolor} color={props.color}>
                3
            </RoundWrapper>
        </div>
    )
}
